# This script runs the Microsoft Tool 'Procmon' (Process Monitor),
# captures system activity, converts logs to CSV, filters results based on user-defined keywords,
# and the logs will be saved as a csv file on Desktop.
# so it asks to enter the keyword/s and then the desired time (Second based) to capture the logs.

# This script runs the Microsoft Tool 'Procmon' (Process Monitor),
# captures system activity, converts logs to CSV, filters results based on user-defined keywords,
# and the logs will be saved as a csv file on Desktop.
# so it asks to enter the keyword/s and then the desired time (Second based) to capture the logs.


# created:      Payam Avarwand - 03.04.2025
# last change:  Payam Avarwand - 04.04.2025

#################################################################################

$Host.UI.RawUI.WindowTitle = "Keyword based Log"

Add-Type -AssemblyName System.Windows.Forms

#################################################################################
# Create the GUI Pop-up for keyword/s

$form = New-Object System.Windows.Forms.Form
$form.Text = "Enter Keywords"
$form.Size = New-Object System.Drawing.Size(350,185)
$form.StartPosition = "CenterScreen"

$label = New-Object System.Windows.Forms.Label
$label.Text = "Enter keywords (comma-separated):"
$label.AutoSize = $true
$label.Location = New-Object System.Drawing.Point(10,10)
$form.Controls.Add($label)

$textBox = New-Object System.Windows.Forms.TextBox
$textBox.Size = New-Object System.Drawing.Size(270,25)
$textBox.Font = New-Object System.Drawing.Font("Arial", 16)
$textBox.Location = New-Object System.Drawing.Point(10,35)
$form.Controls.Add($textBox)

$okButton = New-Object System.Windows.Forms.Button
$okButton.Text = "OK"
$okButton.Size = New-Object System.Drawing.Size(80,30)
$okButton.Location = New-Object System.Drawing.Point(160,85)
$okButton.Add_Click({ $form.DialogResult = [System.Windows.Forms.DialogResult]::OK })
$form.Controls.Add($okButton)

$textBox.Add_KeyPress({
    if ($_.KeyChar -eq [char]13) {  
        $form.DialogResult = [System.Windows.Forms.DialogResult]::OK
    }
})

if ($form.ShowDialog() -eq [System.Windows.Forms.DialogResult]::OK) {
    $keywordsInput = $textBox.Text
} else {
    exit
}

$keywords = $keywordsInput -split "\s*,\s*"

#################################################################################
# Create the GUI Pop-up for duration

$formDuration = New-Object System.Windows.Forms.Form
$formDuration.Text = "Capture Duration"
$formDuration.Size = New-Object System.Drawing.Size(550,180)
$formDuration.StartPosition = "CenterScreen"

$labelDuration = New-Object System.Windows.Forms.Label
$labelDuration.Text = "Enter capture duration (Seconds) [empfohlen, maximal 5]:"
$labelDuration.Font = New-Object System.Drawing.Font("Arial", 9)
$labelDuration.Location = New-Object System.Drawing.Point(10,10)
$labelDuration.AutoSize = $true
$formDuration.Controls.Add($labelDuration)

$textBoxDuration = New-Object System.Windows.Forms.TextBox
$textBoxDuration.Size = New-Object System.Drawing.Size(150,30)
$textBoxDuration.Font = New-Object System.Drawing.Font("Arial", 16)
$textBoxDuration.Location = New-Object System.Drawing.Point(10,40)
$formDuration.Controls.Add($textBoxDuration)

$okButtonDuration = New-Object System.Windows.Forms.Button
$okButtonDuration.Text = "OK"
$okButtonDuration.Size = New-Object System.Drawing.Size(80,30)
$okButtonDuration.Location = New-Object System.Drawing.Point(130,85)
$okButtonDuration.Add_Click({ $formDuration.DialogResult = [System.Windows.Forms.DialogResult]::OK })
$formDuration.Controls.Add($okButtonDuration)

$textBoxDuration.Add_KeyPress({
    if ($_.KeyChar -eq [char]13) {
        $formDuration.DialogResult = [System.Windows.Forms.DialogResult]::OK
    }
})

do {
    if ($formDuration.ShowDialog() -eq [System.Windows.Forms.DialogResult]::OK) {
        $durationInput = $textBoxDuration.Text -as [int]
        if (-not $durationInput -or $durationInput -le 0) {
            Write-Output "Invalid duration entered. Please enter a positive number."
            $textBoxDuration.Text = ""
        }
    } else {
        return
    }
} while (-not $durationInput -or $durationInput -le 0)

Write-Output "Logs will be captured for $durationInput seconds"

#################################################################################
# Path Definition

$timestamp = Get-Date -Format "yyyy-MM-dd"
$desktopPath = "$env:USERPROFILE\Desktop"
$tempPath = "C:\temp"
$procmonExePath = "$tempPath\Procmon64.exe"
$logPath = "$tempPath\Procmon.PML"
$csvPath = "$tempPath\Procmon.csv"

if (-not (Test-Path -Path $tempPath)) {
    New-Item -Path $tempPath -ItemType Directory -Force | Out-Null
}

#################################################################################
# Use the Procmon

$base64Procmon = @"

"@

try {
    [System.IO.File]::WriteAllBytes($procmonExePath, [Convert]::FromBase64String($base64Procmon))
} catch {
    Write-Output "Error: Failed to decode and save Procmon64.exe."
    exit
}

if (-not $keywords) {
    Write-Output "No keywords entered. Exiting..."
    exit
}

#################################################################################
# Construct filename dynamically based on keywords

$keywordsJoined = ($keywords -join "_")
$filteredCsvName = "Procmon_$keywordsJoined" + "_$timestamp.csv"
$filteredCsvPath = "$desktopPath\$filteredCsvName"

#################################################################################
# Function to capture logs

function Capture-Logs {
    param (
        [int]$durationInput,
        [string]$logPath,
        [string]$procmonExePath
    )
    Write-Output "Capturing logs for $durationInput seconds..."
    Start-Process -FilePath $procmonExePath -ArgumentList "/AcceptEula", "/Minimized", "/Backingfile $logPath" -ErrorAction Stop
    Start-Sleep -Seconds $durationInput
    Write-Output "Stopping capture..."
    Start-Process -FilePath $procmonExePath -ArgumentList "/Terminate" -NoNewWindow -Wait
    Stop-Process -Name "Procmon64" -Force -ErrorAction SilentlyContinue
}

#################################################################################
# Start Procmon and capture logs

Capture-Logs -durationInput $durationInput -logPath $logPath -procmonExePath $procmonExePath

#################################################################################
# Convert and filter logs

if (Test-Path $logPath) {
    Write-Output "Converting log to CSV..."
    Start-Process -FilePath $procmonExePath -ArgumentList "/OpenLog", "$logPath", "/Minimized", "/SaveAs", "$csvPath" -NoNewWindow -Wait

    if (Test-Path $csvPath) {
        Write-Output "Filtering and saving CSV output..."

        $csvData = Import-Csv -Path $csvPath

        # Filter rows using whole-word keyword search
        $filteredRows = $csvData | Where-Object {
            $entry = $_
            $text = ($entry.PSObject.Properties.Value -join ' ').ToLower()
            # Match strictly for 'rdp.' and '.rdp' (not splitting the word boundary)
            ($keywords | Where-Object { $text -like "*$_*" }) -and
            $entry."Process Name" -notlike "*procmon*"
        }

        # Always save a file — even if it's empty (just with headers)
        if ($filteredRows.Count -gt 0) {
            $filteredRows | ConvertTo-Csv -NoTypeInformation | ForEach-Object { $_ -replace ",", ";" } | Set-Content -Path $filteredCsvPath -Encoding UTF8
        } else {
            # If no rows matched, create CSV with only headers
            $csvData[0] | Select-Object * | ConvertTo-Csv -NoTypeInformation | ForEach-Object { $_ -replace ",", ";" } | Set-Content -Path $filteredCsvPath -Encoding UTF8
            Write-Output "No matches found. Empty output file created with headers."
        }

        if (Test-Path $filteredCsvPath) {
            Write-Output "Output was created at $filteredCsvPath!"
        } else {
            Write-Output "Error: CSV saving failed!"
        }

        Remove-Item -Path $csvPath -Force -ErrorAction SilentlyContinue
        Remove-Item -Path $logPath -Force -ErrorAction SilentlyContinue
    } else {
        Write-Output "Error: CSV conversion failed!"
    }
} else {
    Write-Output "Error: Log file not found!"
}

#################################################################################
# Clean up

if (Test-Path $procmonExePath) {
    Remove-Item -Path $procmonExePath -Force -ErrorAction SilentlyContinue
    Write-Output "> info: Temp files were removed."
}

